import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import GeneralInfo from './pages/GeneralInfo';
import Technology from './pages/Technology';
import TechnicalInfo from './pages/TechnicalInfo';
import FutureTech from './pages/FutureTech';
import Social from './pages/Social';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/genel-bilgiler" element={<GeneralInfo />} />
          <Route path="/teknik-bilgiler" element={<TechnicalInfo />} />
          <Route path="/teknolojiler" element={<Technology />} />
          <Route path="/gelecek-teknolojiler" element={<FutureTech />} />
          <Route path="/sosyal" element={<Social />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
